An if statement is used to execute a section of code if an expression results to true. A great way to look at this is an example: var a = 5 if (a == 5) { println("True!")
} Since a is indeed equal to 5, then the program will execute println("True!"), however, let's say we had, var a = 5 if (a == 6) { println("True!")
} Since a doesn't equal to 6, the expression results to false, so the program doesn't print anything.

