An else statement is used to execute a section of code if an expression results to false. Let's fix our previous example a bit to include an else statement: var a = 5 if (a == 6) { println("True!")
} else { println("False!")
} Since a doesn't equal to 6, it follows the else statement, and executes println("False!").

