In Kotlin, a parameter is a piece of data we can pass into a function when invoking it. To pass data into a function, the function’s header must include parameters that describe the name and data type of the incoming data. If a function is declared with parameters, then data must be passed when the function is invoked. We can include as many parameters as needed. fun birthday(name: String, age: Int) { println("Happy birthday $name! You turn $age today!")
} fun main() { birthday("Oscar", 26) // Prints: Happy birthday Oscar! You turn 25 today! birthday("Amarah", 30) // Prints: Happy birthday Amarah! You turn 30 today!
}

